(function(){
	angular.module("defaultnavigator",["ngCookies","ui.router","defaultTools"])
	.run(function(){
		console.log("Default Navigator Module injected");
	})
	.config(function($stateProvider, $urlRouterProvider) {
		$stateProvider
			.state('root', {
				url: '',
				templateUrl: '/default'
			})
			.state('default', {
				url: '/',
				templateUrl: '/default'
			})
	})
})();